"use strict";
Object.defineProperty(exports, "__esModule", { value: true });
const date_fns_1 = require("calendar-utils/date-adapters/date-fns");
const addWeeks = require("date-fns/add_weeks/index");
const addMonths = require("date-fns/add_months/index");
const subDays = require("date-fns/sub_days/index");
const subWeeks = require("date-fns/sub_weeks/index");
const subMonths = require("date-fns/sub_months/index");
const getISOWeek = require("date-fns/get_iso_week/index");
const setDate = require("date-fns/set_date/index");
const setMonth = require("date-fns/set_month/index");
const setYear = require("date-fns/set_year/index");
const getDate = require("date-fns/get_date/index");
const getYear = require("date-fns/get_year/index");
function adapterFactory() {
    return Object.assign({}, date_fns_1.adapterFactory(), { addWeeks,
        addMonths,
        subDays,
        subWeeks,
        subMonths,
        getISOWeek,
        setDate,
        setMonth,
        setYear,
        getDate,
        getYear });
}
exports.adapterFactory = adapterFactory;
